import React, { useState } from 'react';

/* Import assets */
import LogoLight from '../assets/logo_light.png';

/* Import bootstrap components */
import Image from 'react-bootstrap/Image';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import FormControl from 'react-bootstrap/FormControl'

function NavigationBar () {
    return (
        <div>
            <Navbar bg = "light" fixed = "top" variant = "light">
                <Navbar.Collapse className = "justify-content-between">
                    <Navbar.Brand><Image src = {LogoLight}/></Navbar.Brand>
                    <Navbar.Collapse className = "justify-content-between">
                        <FormControl type="text" placeholder="Search" className="mr-auto" />
                    </Navbar.Collapse>
                    <Navbar.Collapse className = "justify-content-between text-dark">
                        <Nav.Link>Sign up</Nav.Link>
                        <Nav.Link>Login</Nav.Link>
                        <Nav.Link>Classroom</Nav.Link>
                        <Nav.Link>Bookmark todo</Nav.Link>
                    </Navbar.Collapse>
                </Navbar.Collapse>
            </Navbar>
        </div>
    );
}

export default NavigationBar;
